import React from "react";

const ExpenseList = ({ expenseList }) => {
  return (
    <div>
      <ul style={{ listStyleType: "none" }}>
        {expenseList.map((expense, index) => (
          <li key={index}>
            {expense}{" "}
            <i className="trash alternate icon" onClick={this.onDelete} />
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ExpenseList;
